		["quote"] = {
			["say"] = {
				["Go. Destroy the Nightmare Lord. Only this way can the Dream be restored... and Azeroth be saved."] = "",
				["It is done! Cenarius is beaten, but my great teacher lives. Now I must focus all of my strength to cleanse him."] = "",
				["My bond with the Emerald Dream gives me great power... but it also makes me vulnerable to the rift's darkness. I have peered inside it and know this to be true. Should I step within, I would be lost... just as Cenarius was."] = "",
				["We must put an end to the Nightmare. Say the word and I will take us into the heart of that twisted place."] = "",
				["Xavius waits ahead in the Rift of Aln, the true heart of the Nightmare. Would that I could fight at your side, heroes, but... to this place, I cannot go."] = "",
			},
			["yell"] = {
				["Truly there was never a soul more noble than Ursoc's. I pray his spirit finds its way back to the Dream."] = "",
				["Now this sacred place has been made into a conduit for the Nightmare to spread its corruption. This we cannot allow!"] = "",
				["If you need further proof of how insidious the Nightmare is, look there! Even the fierce heart of Ursoc has succumbed. Release him, I beg you!"] = "",
				["Yes, Cenarius! We are here to save you!"] = "",
				["From each of these pathways, a palpable evil emanates. Choose a course, and know that I will stand with you."] = "",
				["I must see with my own eyes what horrors have befallen my beloved teacher. Steel your hearts against the darkness, heroes."] = "",
				["No doubt Xavius and his ancient master delight that so much of our attention goes into fighting the Legion. Their insidious shadow seeps into our world, distracting us with whispers and doubts."] = "",
				["What manner of foul creature is this? It seems poised to unleash its corruption upon Thunder Bluff! The spirit of the tauren people must not fall prey to the Nightmare!"] = "",
				["This was the Emerald Dreamway. During my long slumber, it was here I communed with the Green Dragonflight."] = "",
				["What horror is this? A tumor of Nightmare infecting a world tree, here in the reflection of the titans' own playground?"] = "",
				["Hold your weapons! He begins to see the truth!"] = "",
				["Moonglade is the most sacred place in all the Dream. To think that my shan'do could play any part in its corruption..."] = "",
				["If this seed takes hold, the roots of its infestation will wind their way into the heart of Azeroth. The Nightmare would devour our world, claiming everything... everyone. This must not come to pass!"] = "",
				["Behold, the Iris opens! The way to Cenarius is clear."] = "",
				["Oh Ysondre! How cruel fate can be! Cleansed of the Nightmare once before, only to become its victim yet again. Some wounds never truly heal."] = "",
			},
		},
